            SET v_category_id = null;
        END IF;
        CLOSE cursorCategory;
        INSERT INTO AD_CATEGORY_TBL(id, ad_id, category_id, created_at, updated_at) VALUES(v_ad_category_id_max, v_ad_id_max, v_category_id, now(), now());
    END IF;
    -- end ad record
END;
